Some seniors are so close to us that they are not like seniors, they are like our best friends. 

Your motivational words were always inspiring,
Your funny talks were enticing,
Your cup of knowledge is ambrosia for us,
The memories we cherished together are beauteous. 

Though we part ways, this is not the end because the Earth is round and we will meet again. Adieu seniors!

